import PostListItem from "~/components/custom/Cards/PostListItem.vue";
import TagFilterHeader from "~/components/custom/TagFilterHeader.vue";
export default {
  components: {
    PostListItem,
    TagFilterHeader
  },
  computed: {
    memberships() {
      var res = [{
        title: "All",
        path: "/team"
      }];
      this.$page.allMembership.edges.forEach(edge => res.push({
        title: edge.node.title,
        path: edge.node.path
      }));
      return res;
    }

  },

  metaInfo() {
    return {
      title: this.$page.membership.title
    };
  }

};
